        org.junit.Assert.assertFalse(metaMap.hasGetter("phone.home.ext"));
        org.junit.Assert.assertEquals("789", metaMap.getValue("phone.office"));
        org.junit.Assert.assertNotNull(metaMap.getValue("phone"));
        org.junit.Assert.assertNull(metaMap.getValue("phone.home"));
